    console.log(loginValue[0]);
    console.log(loginValue[1]);
}

const NavLinkBtn = () => {
    return <NavLink>

    </NavLink>
}

const Btn = ({text, fontSize}) => {
    return <button style={{
        fontSize,
        }} onClick={onClick}>
        </button>
}

Btn.propTypes = {
    text: propTypes.string.isRequired,
    fontSize: propTypes.number.isRequired,
}

export default Btn;
